import React, { useCallback } from "react";

import { useDispatch } from "react-redux";
import { SIGN_UP } from "../reducers/sign";

export const onClickToSignUp = useCallback((e) => {
  const dispatch = useDispatch();

  e.preventDefault();
  dispatch({ type: SIGN_UP });

  return dispatch;
}, []);
